import React from "react";
import ReactDOM from "react-dom/client";
import { createRoot } from 'react-dom/client'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
// import socketIO from 'socket.io-client';
import * as socketIO from 'socket.io-client';
// import { io } from "socket.io-client";
import "./index.css";
import App from "./App";

const rootElement = ReactDOM.createRoot(document.getElementById("root"));
if (!rootElement) throw new Error('Failed to find the root element')
const root = createRoot(rootElement)
root.render(
  <React.StrictMode>
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/userparams" element={<Settings />} />{' '}
                {/* Change user in login (login/amontautparams) + cannot acces page if not logged in*/}
                <Route path="/Friends" element={<Friends />} />
                <Route path="/StatsAndMatch" element={<StatsAndMatch />} />
                <Route path="/Chat" element={<Chat />} />
                <Route path="/Chat/conv" element={<TheConv />}></Route>
                <Route path="/chat/try" element={<ChatWidget socket={socket} username={'alice'} room={1}/>}></Route>
                <Route path="/WatchGame" element={<WatchLive />} />
                <Route path="/PrintProfile/:username" element={<PrintProfile/>} />
                <Route path="*" element={<Error404 />} />
            </Routes>
            <Footer />
        </Router>
    </React.StrictMode>


  // <>
  //   <App />
  // </>
);
